import React, { Component } from 'react'
import Masonry from 'react-masonry-component';
//import Masonry from 'react-masonry-css';
import axios from 'axios';
import LoadMoreComponent from '../LoadMoreComponent';
import EmptyImageComponent from './EmptyImageComponent';
const masonryOptions = {
    horizontalOrder: true,
    percentPosition: true,
    fitWidth: true
};

const imagesLoadedOptions = { background: '.my-bg-image-el' }
const style = {
    position: 'relative'
};
class ImageGalleryComponent extends Component {
    constructor(props) {
        super();
        this.state = {
            freeContents: {
                images: [],
                videos: []
            },
            premiumContents: {
                images: [],
                videos: []
            },
            visible: 10,
            error: false
        }

        this.loadMore = this.loadMore.bind(this);

    }
    componentDidMount() {
        const self = this;
        axios.get(API_URL + `performer/contents?customer_id=${customerID}&performer_id=${performerID}`)
        .then(function (response) {
            const data = response.data;
            if(data) {
                self.setState({
                    ...self.state,
                    freeContents: data.freeContents,
                    premiumContents: data.premiumContents,
                    performerDetails: data.performerDetails,
                });
            }
        })
        .catch(function (error) {
            // handle error
            this.setState({
                error: true
            });
        })
        .finally(function () {
            // always executed
        });
    }
    loadMore() {
        this.setState((prev) => {
          return {visible: prev.visible + 20};
        });
      }
    render() {
        const {images} = [];


        if(images) {
            const ImageCOM = images.slice(0, this.state.visible).map(function(image) {
                const IMG = 'http://localhost/adultlounge/' + image.imagePath;
                return (<li>
                            <img src={IMG}></img>
                        </li>);
             });
            return (<React.Fragment>
                <h4 className="free-image-heading">Free Image</h4>
                <Masonry
                    className={'grid effect-1 masonary-ul'}
                    elementType={'ul'}
                    options={masonryOptions}
                >
                    {ImageCOM}
                </Masonry>
                {/* {this.state.freeContents.images.length > 0 ? <LoadMoreComponent onClick={this.loadMore}/>: null} */}
                {this.state.visible < images.length &&
                    <LoadMoreComponent loadMore={this.loadMore}/>
                }
            </React.Fragment>)
        } else {
            return(
                <React.Fragment>
                    <EmptyImageComponent/>
                </React.Fragment>
            )

        }

    }
}
export default ImageGalleryComponent;
